import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const styles = {
  pageContainer: {
    position: 'relative',
    backgroundColor: '#2C3E50', // Background color taken from the photo provided
    width: '100vw',
    height: '100vh',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  formContainer: {
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    borderRadius: '10px',
    padding: '2rem',
    backgroundColor: 'white',
    width: '80%', // Adjusted based on the photo for a wider form
    maxWidth: '800px', // Maximum width of the form container
    display: 'grid',
    gridTemplateColumns: '1fr 1fr', // Split into two columns
    gridGap: '1rem', // Space between grid items
    alignItems: 'start', // Align items to the start of each grid cell
  },
  input: {
    width: '100%',
    height: '50%',
    padding: '10px',
    borderRadius: '5px',
    border: '1px solid #ccc',
    fontSize: '1rem',
  },
  textarea: {
    gridColumn: '1 / -1', // Textarea spans both columns
    height: '5rem',
    padding: '10px',
    borderRadius: '5px',
    border: '1px solid #ccc',
    fontSize: '1rem',
    resize: 'none',
  },
  select: {
    width: '100%',
    padding: '10px',
    borderRadius: '5px',
    border: '1px solid #ccc',
    fontSize: '1rem',
    background: 'white',
    '-moz-appearance': 'none',
    '-webkit-appearance': 'none',
    appearance: 'none',
  },
  button: {
    gridColumn: '1 / -1', // Button spans both columns
    backgroundColor: '#17A2B8',
    color: 'white',
    padding: '15px 30px',
    borderRadius: '20px',
    border: 'none',
    fontSize: '1rem',
    cursor: 'pointer',
    transition: 'background-color 0.3s',
  },
  nextButton: {
    position: 'absolute',
    top: '20px',
    right: '20px',
    backgroundColor: '#17A2B8',
    color: 'white',
    borderRadius: '50%',
    width: '40px',
    height: '40px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    cursor: 'pointer',
    fontSize: '24px',
    border: 'none',
    textDecoration: 'none',
    outline: 'none',
  },
};

function CreateForm() {
  const [isHovered, setIsHovered] = useState(false);
  const [formData, setFormData] = useState({
    taskTitle: '',
    taskDescription: '',
    estTime: '',
    deadline: '',
    priorityLevel: '',
    assignee: '',
  });
  const navigate = useNavigate();

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData(prevState => ({ ...prevState, [name]: value }));
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log('Form Data:', formData);
    // Implementation needed for actual task creation logic, possibly involving API calls
  };

  const handleNextClick = () => {
    navigate('/admin'); // Replace with your next form's path
  };

  return (
    <div style={styles.pageContainer}>
      <form style={styles.formContainer} onSubmit={handleSubmit}>
        <input
          style={styles.input}
          type="text"
          name="taskTitle"
          value={formData.taskTitle}
          onChange={handleChange}
          placeholder="Task Title"
        />
        {/* <input
          style={styles.input}
          type="text"
          name="estTime"
          value={formData.estTime}
          onChange={handleChange}
          placeholder="EST. time"
        /> */}
        <textarea
          style={styles.textarea}
          name="taskDescription"
          value={formData.taskDescription}
          onChange={handleChange}
          placeholder="Task Description"
        />
        <input
          style={styles.input}
          type="date"
          name="DateOfBirth"
          value={formData.DateOfBirth}
          onChange={handleChange}
        />
        <select
          style={styles.select}
          name="priorityLevel"
          value={formData.priorityLevel}
          onChange={handleChange}
        >
          <option value="" disabled hidden>Priority Level</option>
          {
            Array.from({ length: 9 }, (_, i) => i + 1).map(level => (
              <option key={level} value={level}>Level {level}</option>
            ))
          }
        </select>
        <select
          style={styles.select}
          name="assignee"
          value={formData.assignee}
          onChange={handleChange}
        >
          <option value="">Assignee</option>
          {/* Insert assignee options here */}
        </select>
        <button
          style={{ ...styles.button, backgroundColor: isHovered ? '#1DA1F2' : '#17A2B8' }}
          onMouseEnter={() => setIsHovered(true)}
          onMouseLeave={() => setIsHovered(false)}
          type="submit"
        >
          Create Task
        </button>
      </form>
      <button
        style={styles.nextButton}
        onClick={handleNextClick}
      >
        &#x3e;
      </button>
    </div>
  );
}

export default CreateForm;
